import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import LandingPage from "./pages/LandingPage";
import AdminPage from "./pages/AdminPage";
import UserPage from "./pages/UserPage";


function App() {
  return (
      <Router>
          <div>
              <Routes><Route path='/' exact component={LandingPage}/></Routes>
              <Routes><Route path='/vadmin' exact component={AdminPage}/></Routes>
              <Routes><Route path='/vuser' exact component ={UserPage} /></Routes>
          </div>
      </Router>
  );
}

export default App;
